(4, 'notice', 'huge-celebration-on-school-campus-for-15th-aug', 'read/huge-celebration-on-school-campus-for-15th-aug', 'Huge Celebration on School Campus for 15th Aug', '2021-08-16', NULL, NULL, NULL, '<p><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\">Huge Celebration in School Campus on 15th Aug</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color: rgb(34, 34, 34); font-family: proxima-regular1, Calibri; font-size: 18px; letter-spacing: 0.5px;\">Independence Day is an annual celebration of the day India gained freedom from foreign rule. It was a historic day for our nation, for after years of struggling against the British rule India was officially free. Indians celebrate this day annually, taking the time to remember the hero&#39;s that helped us gain Independence.</span></p>\r\n\r\n<p><span style=\"color: rgb(34, 34, 34); font-family: proxima-regular1, Calibri; font-size: 18px; letter-spacing: 0.5px;\">India had been ruled by the British for several years. For about 100 years India was ruled by the East India Company. In 1757 the Company won the Battle of Plassey started exerting power over India. In 1957 India had it&#39;s first rebellion against the foreign rule in which almost the entire country united against the British. Unfortunately, India was defeated but after that Indian rule passed to the British crown who ruled til India was independent. It was only after a long campaign for independence and Britain being weakened after two world wars was India finally granted it&#39;s freedom.</span></p>\r\n\r\n<p><img src=\"https://thewingshield.com/school_src/uploads/gallery/media/15aug4.jpg\" style=\"height: 280px; width: 500px;\" /></p>\r\n\r\n<div>&nbsp;</div>', 'no', '2021-09-13 07:16:45', '', '', '', '', '0000-00-00', '0', NULL);
