INSERT INTO `tb_pagecontain` (`id`, `title`, `add_subtitle`, `direction`, `position`, `description`, `file`, `statu`, `created_at`, `update_at`) VALUES
(3, 'Welcome to G.K. Public School', '', '1', '1', '<p><span xss=removed>Our True Motto is “ GO FORTH & CONQUER”. We provide a place where a Child is nurtured Intellectually, psychologically & Spiritually.</span><span xss=removed> Education is our main passport to the Future for tomorrow belongs to the people who prepare for it. GPS Indore, a reputed School affiliated with the MP Board School from Nursery to 12th stands out as a unique institution of learning having completed 18 years of Credible accomplishment.</span></p>', 'https://localhost/school_src/uploads/page_content/welcome.jpg', '0', '2021-09-10 09:34:11', '2021-09-13 06:06:38'),
(4, 'View Our 2021-2022 Reopening Plan', 'Enroll', '2', '1', '<p><span xss=\"removed\">Enroll now! Our learning methods are of the highest quality using the most recent and modern teaching equipment. We offer various group activities that suit all kinds of ages.</span></p>\r\n', 'https://localhost/school_src/uploads/page_content/50654464.png', '0', '2021-09-10 09:35:40', '2021-09-13 06:06:39'),
(5, 'Teach', 'Our teachers', '2', '2', '<p><span xss=removed>Our teachers are trained to provide an invigorating classroom environment where every learner can develop mental agility through independent thinking and reflection.</span></p>', 'https://localhost/school_src/uploads/page_content/50654461.png', '0', '2021-09-10 09:37:31', '2021-09-10 09:58:34'),
(6, 'Support', 'Support', '2', '3', '<p><span xss=removed>To improve the practical efficiency of the students by developing a scientific attitude to think objectively. competent enough to play their part effectively in social and economic development.</span></p>', 'https://localhost/school_src/uploads/page_content/50654462.png', '0', '2021-09-10 09:38:06', '2021-09-10 09:47:52'),
(7, 'Grow', 'Grow', '2', '4', '<p><span xss=removed>To develop a mindset for continuous improvement and excellence in work and to promote a sense of discipline and imbibe a sense of responsibility and devotion to work.</span></p>', 'https://localhost/school_src/uploads/page_content/50654463.png', '0', '2021-09-10 09:38:30', '2021-09-10 09:47:41');
